import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p><label for="icon-button-file"> Take Image </label></p>
      <input accept='image/*' id="icon-button-file" type="file"
        capture="environment" />
    </div>
  );
}

export default App;
